  const[listItem, setListItem]=  useState([]);
  const API = "http://www.songsterr.com/a/ra/songs/byartists.json?";

  useEffect(()=>{
    window
      .fetch(`${API}artists=Juanes`)
      .then((response) => response.json())
      .then(data=>{
        console.log(data)
        setListItem(data)
      });
  },[])

  return (
    <div>
      {listItem.map((song)=>{
        return <Item>
        <p href="" key={song.id}>{song.title}</p>
        <Link href=""> escuchar</Link>
        <Link href=""> letra</Link>
        <Link href=""> acordes</Link>
        </Item>
      })}
    </div>
  );
};

export default List;
